export class ComplicationGlucidique
{
    PatientId:number;
    AnomalieGlucidiqueAuCoursSuivi:string;
    AgeApparitionAnomaliesGlucidique:number;
    NecessiteMedicamentAntiDiabetique:string;
    EvalutionAnomalieGlucidique:string;
    AnomaliesGlucidiquesActuel:string;
    MedicamentAntidiabetiqueActuel:string;

    constructor()
    {
        this.PatientId=0;
        this.AnomalieGlucidiqueAuCoursSuivi='';
        this.AgeApparitionAnomaliesGlucidique=0;
        this.NecessiteMedicamentAntiDiabetique='';
        this.EvalutionAnomalieGlucidique='';
        this.AnomaliesGlucidiquesActuel='';
        this.MedicamentAntidiabetiqueActuel='';

    }
}
